INSERT INTO `wp_options` VALUES (104,'widget_block','a:24:{i:2;a:1:{s:7:\"content\";s:19:\"<!-- wp:search /-->\";}i:3;a:1:{s:7:\"content\";s:154:\"<!-- wp:group --><div class=\"wp-block-group\"><!-- wp:heading --><h2>Recent Posts</h2><!-- /wp:heading --><!-- wp:latest-posts /--></div><!-- /wp:group -->\";}i:4;a:1:{s:7:\"content\";s:227:\"<!-- wp:group --><div class=\"wp-block-group\"><!-- wp:heading --><h2>Recent Comments</h2><!-- /wp:heading --><!-- wp:latest-comments {\"displayAvatar\":false,\"displayDate\":false,\"displayExcerpt\":false} /--></div><!-- /wp:group -->\";}i:5;a:1:{s:7:\"content\";s:146:\"<!-- wp:group --><div class=\"wp-block-group\"><!-- wp:heading --><h2>Archives</h2><!-- /wp:heading --><!-- wp:archives /--></div><!-- /wp:group -->\";}i:6;a:1:{s:7:\"content\";s:150:\"<!-- wp:group --><div class=\"wp-block-group\"><!-- wp:heading --><h2>Categories</h2><!-- /wp:heading --><!-- wp:categories /--></div><!-- /wp:group -->\";}i:7;a:1:{s:7:\"content\";s:393:\"<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">A Motown Christmas is a powerful family-oriented show combining Motown’s greatest hits with everyone’s favorite holiday classics. This show features those famous Motown trademarks: dazzling choreography and unforgettable harmonies all performed in that memorable, soulful Motown style.​</p>\n<!-- /wp:paragraph -->\";}i:9;a:1:{s:7:\"content\";s:1322:\"<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":114,\"sizeSlug\":\"large\",\"linkDestination\":\"none\",\"className\":\"home-banner-img\"} -->\n<figure class=\"wp-block-image size-large home-banner-img\"><img src=\"http://motownchristmas.local/wp-content/uploads/2024/04/cid_F13674B2-2-copy-1024x534.png\" alt=\"\" class=\"wp-image-114\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"className\":\"home-banner-text\"} -->\n<div class=\"wp-block-column home-banner-text\"><!-- wp:heading {\"textAlign\":\"center\",\"level\":3,\"className\":\"home-banner-text\"} -->\n<h3 class=\"wp-block-heading has-text-align-center home-banner-text\">Starring</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"className\":\"banner-h2\"} -->\n<h2 class=\"wp-block-heading has-text-align-center banner-h2\">The Motortown All-Stars</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"wp-block-heading has-text-align-center\">Featuring Former Members of the</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"className\":\"banner-h2\"} -->\n<h2 class=\"wp-block-heading has-text-align-center banner-h2\">Temptations &nbsp; Contours &nbsp; Miracles</h2>\n<!-- /wp:heading --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\";}i:10;a:1:{s:7:\"content\";s:309:\"<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"className\":\"home-button\"} -->\n<div class=\"wp-block-button home-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"http://motownchristmas.local/tourschedule/\">Tour Schedule</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons -->\";}i:11;a:1:{s:7:\"content\";s:929:\"<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"#ffff00\"}}},\"color\":{\"text\":\"#ffff00\"}},\"className\":\"about-header-h2\"} -->\n<h2 class=\"wp-block-heading about-header-h2 has-text-color has-link-color\" style=\"color:#ffff00\">Meet The All-Stars</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"about-header-p\"} -->\n<p class=\"about-header-p\">The Motortown All-Stars were assembled from a host of world class vocalists drawn from the ranks of Motown\'s most legendary groups and other classic groups, and features former members of Ali Woodson\'s Temptations, The Miracles, The Contours, and most recently the Dramatics. The show is jam-packed with impeccable harmonies, dazzling choreography, and those many Motown hits everyone loves.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\";}i:12;a:1:{s:7:\"content\";s:309:\"<!-- wp:image {\"id\":31,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"about-header-img\"} -->\n<figure class=\"wp-block-image size-full about-header-img\"><img src=\"http://motownchristmas.local/wp-content/uploads/2024/04/motown_christmas_logo.png\" alt=\"\" class=\"wp-image-31\"/></figure>\n<!-- /wp:image -->\";}i:13;a:1:{s:7:\"content\";s:258:\"<!-- wp:image {\"id\":132,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://motownchristmas.local/wp-content/uploads/2024/05/Charles-Franklin.jpg\" alt=\"\" class=\"wp-image-132\"/></figure>\n<!-- /wp:image -->\";}i:14;a:1:{s:7:\"content\";s:208:\"<!-- wp:paragraph {\"align\":\"center\",\"className\":\"about-performer-p\"} -->\n<p class=\"has-text-align-center about-performer-p\">Charles Franklin, formerly with Ali Woodson\'s Temptations</p>\n<!-- /wp:paragraph -->\";}i:15;a:1:{s:7:\"content\";s:256:\"<!-- wp:image {\"id\":133,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://motownchristmas.local/wp-content/uploads/2024/05/Danny-Friendly.jpg\" alt=\"\" class=\"wp-image-133\"/></figure>\n<!-- /wp:image -->\";}i:16;a:1:{s:7:\"content\";s:194:\"<!-- wp:paragraph {\"align\":\"center\",\"className\":\"about-performer-p\"} -->\n<p class=\"has-text-align-center about-performer-p\">Danny Friendly, former member of The Edsels</p>\n<!-- /wp:paragraph -->\";}i:17;a:1:{s:7:\"content\";s:251:\"<!-- wp:image {\"id\":134,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://motownchristmas.local/wp-content/uploads/2024/05/Glen-Raby.jpg\" alt=\"\" class=\"wp-image-134\"/></figure>\n<!-- /wp:image -->\";}i:18;a:1:{s:7:\"content\";s:248:\"<!-- wp:paragraph {\"align\":\"center\",\"className\":\"about-performer-p\"} -->\n<p class=\"has-text-align-center about-performer-p\">Glen Raby, Musical Director and former Musical Director of The Contours among other Motown groups</p>\n<!-- /wp:paragraph -->\";}i:19;a:1:{s:7:\"content\";s:250:\"<!-- wp:paragraph {\"align\":\"center\",\"className\":\"about-performer-p\"} -->\n<p class=\"has-text-align-center about-performer-p\">Leon Franklin - formerly of The Miracles, The Contours, and currently performing with The Dramatics</p>\n<!-- /wp:paragraph -->\";}i:20;a:1:{s:7:\"content\";s:255:\"<!-- wp:image {\"id\":135,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://motownchristmas.local/wp-content/uploads/2024/05/Leon-Franklin.jpg\" alt=\"\" class=\"wp-image-135\"/></figure>\n<!-- /wp:image -->\";}i:21;a:1:{s:7:\"content\";s:259:\"<!-- wp:image {\"id\":136,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://motownchristmas.local/wp-content/uploads/2024/05/Antonio-Dandridge.jpg\" alt=\"\" class=\"wp-image-136\"/></figure>\n<!-- /wp:image -->\";}i:22;a:1:{s:7:\"content\";s:170:\"<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Antonio Dandridge, godson of Martha Reeves and Detroit area performer</p>\n<!-- /wp:paragraph -->\";}i:23;a:1:{s:7:\"content\";s:256:\"<!-- wp:image {\"id\":133,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://motownchristmas.local/wp-content/uploads/2024/05/Danny-Friendly.jpg\" alt=\"\" class=\"wp-image-133\"/></figure>\n<!-- /wp:image -->\";}i:24;a:1:{s:7:\"content\";s:259:\"<!-- wp:image {\"id\":136,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://motownchristmas.local/wp-content